import React from 'react';
import './Profile.css';
import pfp from './images/pfp.jpg'
import Badges from './Badges'

function Profile({ profile }) {
    const stats = profile.Bio.Stats.map((s) => {
        <p><strong></strong></p>
    });

    const description = profile.Bio.Description.map((d) => {
        <p>{d}</p>
    });

    return (
        <div className="profile">
            <div class="profile__bio">
                <div className="profile__img">
                    <img alt="cow" src={pfp} />
                </div>
                <div className="profile__text">
                    <h1>{profile.Bio.Name}</h1>
                    <div className="profile__stats">
                        <p><strong>14</strong> countries ✈️</p>
                        <p><strong>2</strong> languages 🗣️</p>
                        <p><strong>4</strong> languages 💻</p>
                    </div>
                    {description}
                    <p>✨ product-focused web engineer 👩🏻‍💻 and engineering manager 👩🏻‍💼</p>
                    <p>⬇️ check out my VR room! ⬇️</p>
                    <p>🚪 <a href="#">cfanguo.me/vr</a> 🔑</p>
                </div>
            </div>
        </div>
    );
}

export default Profile;
